import React from 'react';
import PostSummary from './projectFront';
import { Link } from 'react-router-dom';

const List = ({users}) => {
    return (
        <div className="post-list section">
            { users && posts.map(post => {
                return (
                    <Link to={'/post/' + post.id}>
                        <PostSummary post={post} key={post.id} />
                    </Link>
                )
            })}
        </div>
    )
} 

export default List;
